function switch_fn(){
    var tab = document.querySelectorAll(".item");
    var tog = document.querySelectorAll(".swt");
    tab.forEach(t => {
        t.classList.toggle("active");
    })
    tog.forEach(c => {
        c.classList.toggle("hid");
    })
}
